import React from "react";
import SvgIcon from '@mui/material/SvgIcon';
import Googleicon from '../../images/googlemap.svg';

export function GoogleIcon (props) {
  return (
    <SvgIcon
      component="span"
      sx={{
        boxSizing: 'content-box',
        }}>
      <img src={Googleicon} alt="ロゴ" width="30" height="30"></img>
    </SvgIcon>
  );
};
